INSERT INTO `news` VALUES (47, 1, '\r\n									帮助中心', '企业会员', '<p style=\"margin-bottom: 20px;text-indent: 32px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">您好，申请成为企业用户条件：</span><strong><span style=\"font-size:16px;font-family:宋体;color:red\">企业行为采购，能提供合法营业执照的单位或公司。</span></strong></p><p style=\"margin-bottom: 20px;text-indent: 32px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">特殊说明：</span></p><p style=\"margin-bottom: 20px;text-indent: 32px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">1.</span><span style=\"font-size: 16px;font-family: 宋体\">欢迎有采购需求的企业用户免费注册，或留言留下您的采购需求，我们客户经理会及时与您联系； 更多专属权益不断提升中，敬请关注。</span></p><p style=\"margin-bottom: 20px;text-indent: 32px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">2.</span><span style=\"font-size: 16px;font-family: 宋体\">会员账号禁止转借或转让他人使用，如因转借或转让他人使用所带来的一切后果，本公司概不负责，如被本公司发现有转借或转让使用情况，本公司则有权立即取消此会员账号的相应级别资格。</span></p><p style=\"text-indent: 400px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">2020-03-26</span></p><p><br/></p>', 'admin', '', 0, '', 1, 1, 1, 1, '2020-03-24 22:53:10', '2020-03-24 22:53:10');
INSERT INTO `news` VALUES (48, 1, '\r\n									帮助中心', '忘记密码', '<p></p><p><span style=\"font-size: 20px;font-family: 宋体\">密码忘记了怎么办？</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px\"><span style=\"font-size: 16px;font-family: 宋体\">1． </span><span style=\"font-size: 16px;font-family: 宋体\">点击华山创业电商平台首页上方的“登录”，进入登录页面；</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-indent:0\"><span style=\"font-size: 16px;font-family: 宋体\"><img src=\"${(domainUrlUtil.EJS_IMAGE_RESOURCES)!}/images/seller/1/60191585061722570.jpg\" _src=\"${(domainUrlUtil.EJS_IMAGE_RESOURCES)!}/images/seller/1/60191585061722570.jpg\"/></span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-indent:0\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px\"><span style=\"font-size: 16px;font-family: 宋体\">2． </span><span style=\"font-size: 16px;font-family: 宋体\">点击“找回密码”页面；</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-indent:0\"><span style=\"font-family: 宋体\"><img src=\"${(domainUrlUtil.EJS_IMAGE_RESOURCES)!}/images/seller/1/44441585061732326.png\" _src=\"${(domainUrlUtil.EJS_IMAGE_RESOURCES)!}/images/seller/1/44441585061732326.png\"/></span></p><p>3． 请账户名绑定的“手机号码”“，然后验证身份后即可重新设置新密码.</p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-indent:0\"><span style=\"font-family: 宋体;\"><img src=\"${(domainUrlUtil.EJS_IMAGE_RESOURCES)!}/images/seller/1/68181585061761569.jpg\" _src=\"${(domainUrlUtil.EJS_IMAGE_RESOURCES)!}/images/seller/1/68181585061761569.jpg\" style=\"white-space: normal;\"/></span></p><p><br/></p><p></p>', 'admin', '', 0, '', 1, 2, 1, 1, '2020-03-24 22:56:43', '2020-06-01 17:00:55');
INSERT INTO `news` VALUES (49, 2, '\r\n									店主之家', '入驻须知', '<p><span style=\"font-size:16px;font-family:宋体\">&nbsp;</span></p><p class=\"MsoListParagraph\" style=\"margin-left: 24px;line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">1．</span><span style=\"font-size: 16px;font-family: 宋体\">华山创业电商平台暂未授权任何机构进行代理招商服务，入驻申请流程及相关的收费说明均以华山创业电商平台官方招商页面为准。</span></p><p class=\"MsoListParagraph\" style=\"margin-left: 24px;line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">2．</span><span style=\"font-size: 16px;font-family: 宋体\">华山创业电商平台有权根据包括但不限于品牌需求、公司经营状况、服务水平等其他因素退回商家入驻申请。</span></p><p class=\"MsoListParagraph\" style=\"margin-left: 24px;line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">3．</span><span style=\"font-size: 16px;font-family: 宋体\">华山创业电商平台有权在申请入驻及后续经营阶段要求商家提供其他资质。</span></p><p class=\"MsoListParagraph\" style=\"margin-left: 24px;line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">4．</span><span style=\"font-size: 16px;font-family: 宋体\">华山创业电商平台将结合各行业发展动态、国家相关规定及消费者购买需求，不定期更新招商标准。</span></p><p class=\"MsoListParagraph\" style=\"margin-left: 24px;line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">5．</span><span style=\"font-size: 16px;font-family: 宋体\">商家必须如实提供资料和信息：</span></p><p style=\"line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">5.1</span><span style=\"font-size: 16px;font-family: 宋体\">请务必确保申请入驻及后续经营阶段提供的相关资质和信息的真实性、完整性、有效性（若商家提供的相关资质为第三方提供，包括但不限于商标注册证、授权书等，请务必先行核实文件的真实有效完整性），一旦发现虚假资质或信息的，华山创业电商平台将不再与商家进行合作并有权根据华山创业电商平台规则及与商家签署的相关协议之约定进行处理；</span></p><p style=\"line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">5.2</span><span style=\"font-size: 16px;font-family: 宋体\">商家应如实提供其店铺运营的主体及相关信息，包括但不限于店铺实际经营主体、代理运营公司等信息；</span></p><p style=\"line-height: 25px\"><span style=\"font-size: 16px;font-family: 宋体\">5.3</span><span style=\"font-size: 16px;font-family: 宋体\">华山创业电商平台关于商家信息和资料变更有相关规定的从其规定，但商家如变更<span>5.2</span>项所列信息，应提前<span>10</span>日书面告知华山创业；如未提前告知华山创业，华山创业将根据华山创业电商平台规则进行处理。</span></p><p><span style=\"font-size: 16px;font-family: 宋体\">6</span><span style=\"font-size: 16px;font-family: 宋体\">．华山创业电商平台暂不接受个体工商户的入驻申请，商家须为正式注册企业，亦暂时不接受非中国大陆注册企业的入驻申请。</span></p><p><br/></p>', 'admin', '', 0, '', 1, 1, 1, 1, '2020-03-24 22:58:11', '2020-03-24 22:58:11');
INSERT INTO `news` VALUES (50, 3, '\r\n									支付方式', '个人用户', '<p><span style=\"font-size:16px;font-family:宋体\">支持微信支付、支付宝支付、银联在线（待上线）</span></p><p><br/></p>', 'admin', '', 0, '', 1, 1, 0, 1, '2020-03-24 22:58:55', '2020-03-24 22:58:55');
INSERT INTO `news` VALUES (51, 3, '\r\n									支付方式', '企业用户', '<p><span style=\"font-size:16px;font-family:宋体\">支持微信支付、支付宝支付、线下转账、货到付款、银联在线（企业）（待上线）</span></p><p><span style=\"font-size:16px;font-family:宋体\">&nbsp;</span></p><p><br/></p>', 'admin', '', 0, '', 1, 2, 0, 1, '2020-03-24 22:59:17', '2020-03-24 22:59:17');
INSERT INTO `news` VALUES (52, 4, '\r\n									售后服务', '联系卖家', '<p><span style=\"font-size: 12pt; font-family: 宋体;\">产地直供，品质保障， 追溯原产地从优质农场到家庭一站式直供。如商品出现质量问题，仅需通过网络或电话提交服务需求申请，华山创业将提供电话技术支持、上门取送等服务内容，为您提供轻松、高效、无忧的售后保障。</span>\r						</p>', 'admin', '', 0, '', 1, 1, 0, 1, '2020-03-24 22:59:39', '2020-03-24 22:59:39');
INSERT INTO `news` VALUES (53, 4, '\r\n									售后服务', '关于退换货', '<p style=\"margin-bottom: 20px;text-indent: 32px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">登陆华山创业电商平台，进入“</span><span><a href=\"https://order.jd.com/center/list.action\" target=\"_blank\"><span style=\"font-size:16px;font-family:宋体;color:#4DB7EB\">我的订单</span></a></span><span style=\"font-size: 16px;font-family: 宋体\">”，点击“退货<span>/</span>换货“菜单可操作退换货及返修，提交成功后请耐心等待，由专业的售后工作人员受理您的申请。</span></p><p style=\"margin-bottom: 20px;text-indent: 32px;line-height: 21px\"><span style=\"font-size: 16px;font-family: 宋体\">因产品质量问题产生的退换货，邮费由卖家承担。非质量问题所产生的退换货，来回邮费买家承担。</span></p><p><br/></p>', 'admin', '', 0, '', 1, 2, 0, 1, '2020-03-24 23:00:05', '2020-03-24 23:00:05');
INSERT INTO `news` VALUES (54, 6, '\r\n									关于我们', '关于我们', '<p style=\"text-indent: 40px\"><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">陕西华山创业有限公司是陕西投资集团有限公司的全资子公司。公司成立于<span>2001</span>年<span>5</span>月<span>30</span>日，注册地址为西安市新城区西一路<span>41</span>号。<span>2006</span>年<span>8</span>月，吸收合并陕西天河能源科技有限责任公司，<span>2016</span>年<span>8</span>月，与陕西能源集团有限公司煤炭运销分公司合并重组，注册资金<span>13.14</span>亿元。<span>&nbsp;&nbsp;&nbsp;</span></span></p><p><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">&nbsp;&nbsp; </span><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">根据管理需要，公司内部设有综合办公室、财务部、风险控制部、人力资源部、企业管理部、党委工作部等管理职能部门。</span></p><p><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">&nbsp;&nbsp; </span><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">公司是集团公司专业化的物流贸易业务板块，以投资和国内外贸易为两大主营业务。近两年来，均实现主营业务收入<span>100</span>多亿元。<span>&nbsp; &nbsp;</span></span></p><p><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">&nbsp;&nbsp; </span><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">公司现有参控股企业<span>17</span>个，其中控股企业<span>4</span>个，参股企业<span>13</span>个。公司是上市公司陕西天然气股份有限公司的第三大股东；公司控股的澳门华山创业国际经济技术合作与贸易有限公司，作为公司在境外注册的子公司，是华山公司对外合作与交流的一个重要窗口。</span></p><p><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">&nbsp;&nbsp; </span><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">公司国内外贸易业务，近年来业务范围不断扩大。公司本部设立了招标集采部、汽车销售事业部、焦炭销售事业部及市场一、二部等部门。主要承担集团公司系统的物资集中采购供应业务、新业务开拓和新公司孵化功能。其中，焦炭出口业务已经在陕西省出口贸易单位中名列前茅，成为省内重要的创汇业务。</span></p><p><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">&nbsp;&nbsp; 2017</span><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">年<span>6</span>月，以增资扩股形式控股的陕西省汉中市瑞达石化有限公司，是公司根据集团公司战略布局，新建立的重要业务领域。该项业务与延长石油集团、中石油陕西公司、中石化陕西公司结成重要的战略合作伙伴，共同做强陕西石油行业。同时，积极走出去，开拓全国市场，把石油业务拓展为华山公司和集团公司的新的业务领域和增长点，为省域经济发展做出贡献。</span></p><p><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">&nbsp;&nbsp; 2018</span><span style=\"font-size: 16px;font-family: 宋体;letter-spacing: 2px\">年<span>5</span>月<span>, </span>华山公司在西安国际港务区出资成立全资子公司陕西投资集团国际贸易有限公司，主要经营国际贸易及货运仓储代理。旨在推广陕投品牌，研究新市场，培育现代物流发展新方向。</span></p><p><br/></p>', 'admin', '', 0, '', 1, 1, 0, 1, '2020-03-24 23:00:33', '2020-03-24 23:00:33');
INSERT INTO `news` VALUES (55, 6, '\r\n									关于我们', '联系我们', '<p>									</p><p>									</p><p>									</p><p>									</p><p><span style=\"font-size:16px;font-family:宋体;color:#333333\">陕西华山创业有限公司<span>&nbsp; </span></span></p><p><span style=\"font-size:16px;font-family:宋体;color:#333333\">地址：陕西省西安市西一路41号</span></p><p><span style=\"font-family:宋体, SimSun;font-size:16px\">联系电话：029-87396371</span></p><p>\r						</p><p>\r						</p><p>\r						</p><p>\r						</p>', 'admin', '', 0, '', 1, 2, 0, 1, '2020-03-24 23:01:03', '2020-05-27 16:37:21');
