  `audit_opinion` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '审核意见',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '活动描述',
