  `back_integral_money` decimal(10, 2) NOT NULL COMMENT '退回积分金额（退回积分转换成金额）',
  `back_coupon_user_id` int(11) NULL DEFAULT NULL COMMENT '退回优惠券ID，0表示没有',
  `back_money_time` datetime(0) NULL DEFAULT NULL COMMENT '退款时间',
