  `product_group_price` int(11) NOT NULL COMMENT '组合价格',
  `state` tinyint(4) NOT NULL DEFAULT 1 COMMENT '1、下架；2、上架；',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`group_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品咨询管理' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of product_group
