  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '属性名称',
  `product_norm_id` int(11) NOT NULL COMMENT '规格ID',
  `sort` int(11) NOT NULL COMMENT '排序',
  `create_id` int(11) NOT NULL COMMENT '创建人',
