  `trans_type` int(11) NULL DEFAULT 0 COMMENT '计价方式 1-按件数 2-按重量',
  `trans_ratio` int(11) NULL DEFAULT 0 COMMENT '换算比例，用于体积与重量的换算',
  `trans_express` int(1) NULL DEFAULT NULL COMMENT '快递',
