-- Records of seller_user_login_log
-- ----------------------------

-- ----------------------------
-- Table structure for settlement
-- ----------------------------
DROP TABLE IF EXISTS `settlement`;
CREATE TABLE `settlement`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `settle_cycle` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '结算周期',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `seller_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商家名称',
  `money_product` decimal(10, 2) NOT NULL COMMENT '商品总金额，等于订单中所有的商品的单价乘以数量之和：orders.money_product总和',
  `money_logistics` decimal(10, 2) NOT NULL COMMENT '物流费用之和：orders.money_logistics总和',
  `money_order` decimal(10, 2) NOT NULL COMMENT '实际应收金额总计：orders.money_order总和',
  `money_paid_balance` decimal(10, 2) NOT NULL COMMENT '余额账户支付总金额：money_paid_balance总和',
  `money_paid_reality` decimal(10, 2) NOT NULL COMMENT '现金支付金额：money_paid_reality总和',
  `money_coupon` decimal(10, 2) NOT NULL COMMENT '优惠码优惠金额：money_coupon总和',
  `money_act_full` decimal(10, 2) NOT NULL COMMENT '订单满减总金额：money_act_full总和',
  `money_discount` decimal(10, 2) NOT NULL COMMENT '优惠金额总额（满减、立减、优惠券等所有优惠额的和）：money_discount总和',
  `money_integral` decimal(10, 2) NOT NULL COMMENT '积分换算金额',
  `integral` int(11) NOT NULL COMMENT '使用积分数量',
  `money_back` decimal(10, 2) NOT NULL COMMENT '当月退款的总金额：退货表back_money总和',
  `money_integral_back` decimal(10, 2) NOT NULL COMMENT '当月退回积分金额的总金额：退货表back_money总和',
  `money_other` decimal(10, 2) NOT NULL COMMENT '其他金额，应支付给商家的其他金额',
  `money_other_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '其他金额加减状态：1、支付增加；2、支付扣减',
  `money_other_reason` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '其他金额理由',
  `commision` decimal(10, 2) NOT NULL COMMENT '佣金',
  `money_sale` decimal(10, 2) NULL DEFAULT NULL COMMENT '三级分销佣金金额',
  `sale_set` tinyint(4) NULL DEFAULT 2 COMMENT '1、平台承担；2、商家承担',
  `payable` decimal(10, 2) NOT NULL COMMENT '应付金额：money_order-money_back-commision',
  `status` tinyint(3) NOT NULL COMMENT '结算状态：1、账单生成；2、平台审核通过；3、商家核对通过；4、商家核对质疑；5、对账完成；6、支付完成',
  `seller_doubt` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商家质疑',
  `platform_explain` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '平台解释',
  `create_time` datetime(0) NOT NULL,
  `update_time` datetime(0) NOT NULL,
  `update_user_id` int(11) NOT NULL COMMENT '修改者ID',
  `update_user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '修改者名称',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 44 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '结算表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of settlement
-- ----------------------------

-- ----------------------------
-- Table structure for settlement_op
-- ----------------------------
DROP TABLE IF EXISTS `settlement_op`;
CREATE TABLE `settlement_op`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orders_id` int(11) NOT NULL COMMENT '订单ID',
  `orders_sn` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单号',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `product_id` int(11) NOT NULL COMMENT '商品id',
  `product_goods_id` int(11) NOT NULL COMMENT '货品ID',
  `spec_info` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '规格详情',
  `product_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `product_sku` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '抽象商品sku',
  `package_groups_id` int(11) NOT NULL DEFAULT 0 COMMENT '促销套装0、不是促销套装；大于0，促销套装ID，价格是促销套装的ID',
  `mall_groups_id` int(11) NOT NULL DEFAULT 0 COMMENT '商城套装0，不是上次套装；大于0商城套装ID',
  `gift_id` int(11) NOT NULL DEFAULT 0 COMMENT '赠品ID 0:不是赠品；大于0：是赠品，存赠品的ID',
  `is_gift` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否是赠品，0、不是；1、是；',
  `money_price` decimal(10, 2) NOT NULL COMMENT '商品单价',
  `number` int(11) NOT NULL COMMENT '商品数量',
  `money_amount` decimal(10, 2) NOT NULL COMMENT '网单金额（减去立减优惠后的金额和）',
  `money_act_single` decimal(10, 2) NOT NULL COMMENT '立减优惠金额和',
  `act_single_id` int(11) NOT NULL DEFAULT 0 COMMENT '单品立减活动ID，无设置0',
  `act_group_id` int(11) NOT NULL DEFAULT 0 COMMENT '团购ID，为0正常购买',
  `act_flash_sale_id` int(11) NOT NULL DEFAULT 0 COMMENT '限时抢购ID，为0正常购买',
  `act_flash_sale_product_id` int(11) NOT NULL DEFAULT 0 COMMENT '限时抢购活动商品ID',
  `act_bidding_id` int(11) NOT NULL DEFAULT 0 COMMENT '集合竞价ID，为0正常购买',
  `act_integral_id` int(11) NOT NULL DEFAULT 0 COMMENT '积分换购ID，为0正常购买',
  `act_integral_num` int(11) NOT NULL DEFAULT 0 COMMENT '使用积分数量',
  `logistics_id` int(11) NULL DEFAULT NULL COMMENT '物流',
  `logistics_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流name',
  `logistics_number` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发票快递单号',
  `shipping_time` datetime(0) NULL DEFAULT NULL COMMENT '发货时间',
  `close_time` datetime(0) NULL DEFAULT NULL COMMENT '网单完成关闭或取消关闭时间',
  `system_remark` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '系统备注，不给用户显示',
  `back_number` int(11) NOT NULL COMMENT '退货数量，默认为0',
  `exchange_number` int(11) NOT NULL COMMENT '换货数量，默认为0',
  `create_time` datetime(0) NOT NULL,
  `update_time` datetime(0) NOT NULL,
  `settlement_id` int(11) NOT NULL COMMENT '结算ID',
  `settle_cycle` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '结算周期',
  `product_cate_id` int(11) NOT NULL COMMENT '商品分类ID',
  `product_cate_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品分类名称',
  `scaling` decimal(10, 3) NOT NULL COMMENT '商品分类分佣比例',
  `commision` decimal(10, 2) NOT NULL COMMENT '网单佣金',
  `sale_money` decimal(10, 2) NULL DEFAULT NULL COMMENT '网单三级分销佣金',
  `settle_time` datetime(0) NOT NULL COMMENT '结算日期',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 73 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '结算网单表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of settlement_op
-- ----------------------------

-- ----------------------------
-- Table structure for suppliers
-- ----------------------------
DROP TABLE IF EXISTS `suppliers`;
CREATE TABLE `suppliers`  (
  `supplier_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `supplier_manager` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT '管理员(关联用户ID)',
  `supplier_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',
  `state` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL DEFAULT '1' COMMENT '1，开启；2，关闭',
  `phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '联系电话',
  `email` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '家庭地址',
  `tax_number` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '税务注册编号',
  `tax_certif` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '税务注册证',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`supplier_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci COMMENT = '供货商信息' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of suppliers
-- ----------------------------

-- ----------------------------
-- Table structure for sys_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu`  (
  `menu_id` int(32) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `menu_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '模块名/菜单名/按钮',
  `menu_icon` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '模块图标',
  `menu_path` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单路径/按钮标识',
  `menu_status` int(1) NULL DEFAULT 1 COMMENT '状态：1启用，2禁用，3已删除',
  `menu_type` int(2) NULL DEFAULT 0 COMMENT '类型：0模块，1菜单，2按钮',
  `btn_type` int(2) NULL DEFAULT NULL COMMENT '按钮类型:对应参数表',
  `menu_kind` int(2) NULL DEFAULT NULL COMMENT '种类：1后台，2公司',
  `menu_sort` int(5) NULL DEFAULT 0 COMMENT '排序号',
  `parent_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '上级ID',
  `create_user` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  `create_date` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_date` datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`menu_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 19 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '菜单信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of sys_menu
-- ----------------------------

-- ----------------------------
-- Table structure for sys_role
-- ----------------------------
DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role`  (
  `role_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键ID',
  `role_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限名',
  `role_status` int(1) NULL DEFAULT 1 COMMENT '是否可用,1：可用，2不可用',
  `role_type` int(1) NULL DEFAULT NULL COMMENT '种类：1后台，2公司',
  `create_date` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `create_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_date` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `update_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`role_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '角色信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of sys_role
-- ----------------------------

-- ----------------------------
-- Table structure for sys_role_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_role_menu`;
CREATE TABLE `sys_role_menu`  (
  `role_menu_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键ID',
  `sys_role_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限ID',
  `sys_menu_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单ID',
  `create_date` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `create_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_date` timestamp(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `update_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`role_menu_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '角色菜单关系表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of sys_role_menu
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user`  (
  `user_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键ID',
  `user_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '账号',
  `user_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '姓名',
  `user_headimg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用户头像',
  `password` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `user_phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '电话',
  `user_email` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '邮箱',
  `user_type` int(1) NULL DEFAULT NULL COMMENT '种类：1后台，2公司',
  `salt` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '盐',
  `status` int(255) NULL DEFAULT 0 COMMENT '状态默认0，1已删除',
  `locked` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '账号是否锁定，1未锁定，2锁定',
  `create_date` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `create_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_date` timestamp(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `update_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of sys_user
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user_role
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_role`;
CREATE TABLE `sys_user_role`  (
  `user_role_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键ID',
  `sys_user_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户ID',
  `sys_role_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限ID',
  `create_date` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `create_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_date` timestamp(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `update_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`user_role_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户角色信息表' ROW_FORMAT = Dynamic;

